He’s already undergone 2 surgeries, and will start radiation therapy and chemotherapy shortly.

The doctors have warned us that many people who are diagnosed with this type of cancer do not live long; HOWEVER, our family is committed to giving him the best quality of life possible and the best fighting chance. He deserves nothing less!!!

Xavier is the sweetest, most caring guy I know. He’s 18 years old, and has so much good in him to bring to this world. I love him with my whole heart.

I believe in miracles, and I know that Xavier is a fighter. His positive outlook on life is evident even now. He’s an absolute inspiration.

After a lot of debate, my family has decided to start a Go Fund Me (link in bio) to support his treatment and give him the best possible chance at a long, healthy life. Many of you have asked us how you can support us, and this is one way that you can. We are SO GRATEFUL for the prayers, kind thoughts, warm gestures, and healing vibes sent his way. We are truly touched.

We continue to believe wholeheartedly in miracles. I will continuously pray for Xavier’s full recovery, and I ask that you do the same. 🙏🏼 your support means so much to me, and to my family.

Xavier — I will fight for you always. You’re my Baby Bear 🐻 and I will always be your Big Sister Bear 🐻

To my community: thank you, thank you, thank you for your prayers, support, & love. ♥️

#XavierStrong 

